};
const styleBack = {
    background: '#ccc',
    height: '500px',
    width: '450px',
    alignItems: 'center',
    borderRadius: "16px",
    margin: '0px auto',
}

const Login = () =>{
    return(
        <div style = {styleBack}>
            <form>
                <Input style={styleInput} placeholder="YourEmail@mail.com" label="Helper text" variant="outlined"/>

            </form>
        </div>
    )
}

export default Login;
